import Map  from 'google-maps-react'
import { Marker } from 'google-maps-react'
// AIzaSyCwXlTdpvthdPzKH6HdfLbL66sH0TVch8s
import { GoogleApiWrapper } from 'google-maps-react'


function App() {
<Map google={props.google} containerStyle={{
      position:"static",
      width:"100%",
      height:"100%"
    }}
    style={
      {
        width:"100%",
        height:"100%"
      }
    }
    center={props.location[0]}
    initalCenter={props.location[0]}
    zoom={props.location.length===1?18:13}
    disableDefaultUI={true}>
    {
      props.location.map((item)=>{
        return<Marker position={item}/>;
      })
    }
    </Map>

}

export default App
